import ResponsiveAppBar from '../components/navbar/navbar-brand';
import Navbar2 from "../components/navbar/navbar-2";
import './App.css';

function App() {
  return(
    <div>

      <div>
        <Navbar2  style={{"margin":"20%"}} />
      </div>

      <div style={{"margin":"20%"}}>
        <ResponsiveAppBar/>
      </div>

    </div>
  );
}

export default App;
